import React from "react";
import "./Toolbar.css";
import logo from "../res/logo.png"

function Toolbar() {
    var username = null
    var localUsername = localStorage.getItem('username')
    var sessionUsername = sessionStorage.getItem('username')

    var usernameDropdownButton = <div>
        <button onClick={dropdownFunction}></button>
        <div id='dropdown-menu'>
            <a href="https://youtube.com">youtube</a>
            <a href="https://youtube.com">youtube</a>
        </div>
    </div>

    function dropdownFunction() {
        document.getElementById('dropdown-menu').hidden = !document.getElementById('dropdown-menu').hidden
    }

    if(localUsername != null) {
        username = localUsername
    }
    if(sessionUsername != null) {
        username = sessionUsername
    }

    console.log(username)

    return (
        <div className="Toolbar">
            <img src={ logo } />
            <a href="/">Home</a>
            <a href="/about">About</a>
            <a href="/projects">Projects</a>
            { (username === null) ? <a href="/login">Login</a> : <a href={"/profile?username=" + username}>{username}</a> }
        </div>
    );
}

export default Toolbar;
